import React, { useState } from 'react';
import MapOfParos from '../MapOfParos/MapOfParos';
import PhotosComponent from '../Photos/Photos';
import Photos from '../../model/Photos';
import './Home.scss';

const Home : React.FC = props => {
    const [day, setDay] = useState(0);
    const photos = Photos.getPhotos();
    const photosOfTheDay = photos[day];

    return (
        <div className={`home`}>
            <header>
                <h2>welcome to</h2>
                <h1>Paros</h1>
            </header>
            <MapOfParos />
            <PhotosComponent photos={photosOfTheDay}/>
        </div>
    );
}

export default Home;
